I need a Java method that takes a string containing parentheses, brackets, and braces듡or example, '[{()}]'드nd determines if they are all correctly balanced. The method should return true if they are balanced and false if they are not.
Response:public static boolean areBracketsBalanced(String input) {
    Stack<Character> stack = new Stack<>();

    for (char ch : input.toCharArray()) {
        switch (ch) {
            case '(': case '[': case '{':
                stack.push(ch);
