                if (stack.isEmpty() || stack.pop() != '[') return false;
                break;
            case '}':
                if (stack.isEmpty() || stack.pop() != '{') return false;
                break;
        }
    }

    return stack.isEmpty();}

Example 2:
Problem:
Write a Java method that checks whether a given string is a palindrome. It should return true if the input string is a palindrome and false otherwise.
Response:public static boolean isPalindrome(String input) {
    String cleaned = input.replaceAll("[^a-zA-Z0-9]", "").toLowerCase();
    int left = 0, right = cleaned.length() - 1;
    while (left < right) {
        if (cleaned.charAt(left++) != cleaned.charAt(right--)) {
            return false;
        }
    }
    return true;
}

